import React from 'react';
import farmsimple from "../../images/logo.jpg";
import './header.css';

export default function Header() {
  return(
   <div data-app="true" class="v-application v-application--is-ltr theme--light" id="app">
      <div class="v-application--wrap">  
   <header data-booted="true">
   
  
        <div class="v-toolbar__content" style={{"height": "64px"}}>
           
      <img src={farmsimple} height="50px" class="mr-5"></img>
      <div class="v-toolbar__title" style={{"color": "rgb(79, 79, 79)"}}><b >FARM</b>SIMPLE Console</div>
      <div class="spacer"></div>
      
      <span data-v-85f12452="" id="userDetails">Align Agith </span> | 
      <span data-v-85f12452="" id="userDetails" style={{"color": "green"}}> Owner</span>
      <button type="button" class="white--text v-btn v-btn--is-elevated v-btn--has-bg theme--light v-size--default deep-orange darken-2"><span class="v-btn__content">Logout </span>
      </button>
      </div>
     
    </header>
      </div>
      </div>
      );
}
